message:
Fix extra line breaks in C# object initializer formatting

Fixed the ObjectInitializerExpression to properly handle multiline formatting without extra newlines between the closing brace and semicolon. This addresses the formatting issue where object initializers would generate:

  new Object
  {
      Property = value
  }
  ;

Instead of the correct:

  new Object
  {
      Property = value
  };

The fix modifies the ObjectInitializerExpression.Write method to use ScopeRaw with newLine=false to prevent the extra newline after the closing brace, while still maintaining proper formatting with a newline before the closing brace.

Co-authored-by: ArcturusZhang <10554446+ArcturusZhang@users.noreply.github.com>
